    false,nt"url": null,nt"notes": "Reindeer, a domestic relative of the caribou,
    were brought to Alaska in1892 from Siberia. The objective of this introduction was
    to provide an alternative food source for Native people during times of wildlife
    shortages. By 1930 there were some 650,000 reindeer in western and northern Alaska.
    Overgrazing of ranges, straying with caribou, predation, and economic, social and
    political factors led to a sharp decline in reindeer populations during the 1930's.
    The Reindeer Act of 1937 established Natives as sole owners of Alaskan reindeer
    and assigned support responsibilities to the Secretary of the Interior. In spite
    of this action, reindeer numbers have remained at a relatively low level. Today,
    there are approximately 30 thousand reindeer in Alaska. A majority of the herds
    occur on the Seward Peninsula while smaller numbers of reindeer persist on Nunivak,
    St. Lawrence, Hagemeister, Kodiak, Umnak, Atka and St. Paul Islands. Reindeer herding
    on the Seward Peninsula and Nunivak Island continue to provide red meat at a relatively
    low cost to local people.",nt"license_title": "License Not Specified",nt"extras":
